import React from "react";
import styled from "styled-components";
import { Button } from "../pages/Contact";
import { ButtonPosition } from "./Card";

const CardEdit = styled.div`
  height: 50%;
  width: 50%;
  background-color: #f2f2f2;
  position: absolute;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Form = styled.form`
  display: flex;
  flex-direction: column;
  gap: 10px;
`;

const Input = styled.input`
  width: 300px;
  height: 35px;
`;

function Edit({setNewTitle, set}) {
  return (
    <CardEdit>
      <Form>
        <Input type="text" required placeholder="New title..."></Input>
        <Input type="text" required placeholder="URL photo..."></Input>
        <ButtonPosition>
          <Button>Cancel</Button>
          <Button>Confirm</Button>
        </ButtonPosition>
      </Form>
    </CardEdit>
  );
}

export default Edit;
